import axios from "axios";
import React, {useEffect} from "react";
import Popup from "reactjs-popup";
import "reactjs-popup/dist/index.css"

function HomePatient (){
 
    const baseURL = "http://localhost:5000/reservation";
    const baseURL2="http://localhost:5000/UpdateReservation";
    const baseURL3="http://localhost:5000/resultat"
    const [reservation, setReservation] = React.useState([]);
    const [resultat,setResultat]=React.useState([]);
 

 
    useEffect(() => {

        axios.get(baseURL)
            .then(res => setReservation(res.data))
            .catch(err => console.log(err));
 
}, [])


useEffect(() => {

    axios.get(baseURL3)
        .then(res => setResultat(res.data))
        .catch(err => console.log(err));

}, [])




const postData=(id)=>{
    axios.put(baseURL2,{
        index:id,
        status:false
        })
        .then(res=>{
            console.log(res.data);
            setReservation(todo=>todo.filter(resv=>resv.reservation_id!==id));//source1: Voir a la fin de la page
        })

        

        .catch(err=>console.log(err));
        
}

    return (
        <div className="hero">
            <div className="container">
                <h1>Page HomePatient</h1>
                <table className="table table-striped">
                    <thead>
                    <h3>Liste des reservations</h3>
                    <tr>
                    <th>Id</th>
                    <th>PatientEmail</th>
                    <th>RAMQ</th>
                    <th>DoctorEmail</th>
                    <th>temps</th>
                    <th>raison</th>
 
                    </tr>
                    </thead>
                    <tbody>
                    {
                        reservation.map((resv) => (
                            <tr key={resv.reservation_id}>
 
                                <td>{resv.reservation_id}</td>
                                <td>{resv.email}</td>
                                <td>{resv.ramq}</td>
                                <td>{resv.doctorEmail}</td>
                                <td>{resv.temps}</td>
                                <td>{resv.raison}</td>
                                <td>
                                <button onClick={()=>postData(resv.reservation_id)} className="btn btn-danger">Annuler</button>
                                </td>
                            </tr>
                        ))
                    }
                    </tbody>
                </table>


                     <div className="col-12">

            <h3>Réception des résultats</h3>
            <form onSubmit={handleSubmit} >

            <div>
            Votre RAMQ: <br />
            <input type="text" name="ramq" maxLength={12} onChange={handleChange2} />
          </div>
          
            <div>
            Votre Email: <br />
            <input type="text" name="patientEmail" onChange={handleChange2}/>
          </div>

          <div>
            DocteurEmail: <br />
            <input type="text" name="doctorEmail" onChange={handleChange2}/>
          </div>

          <div>
            Message: <br />
            <textarea type="text" name="message" rows="4" cols="50" onChange={handleChange2} />
          </div>

          <br></br>

          <button onClick={handleSubmit} type="button" className="btn btn-primary">Envoyer le formulaire</button>


            </form>
            

            </div>
        

            </div>
 
        </div>
    );
    }
    export default HomePatient;

